import { HTMLAttributes } from 'react';

type LogoProps = HTMLAttributes<SVGElement>;

const Logo = ({ ...props } : LogoProps) => {
    return (
        <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1000 1000" {...props}>
            <image xlinkHref="data:image/png;base64,"/>
        </svg>
    );
};

export default Logo;